import '../css/Dashboard.css'
import React, { Component } from 'react';


const socket = new WebSocket("ws://192.168.50.252:13255");

socket.addEventListener("message", (event) => {
  let type = event.data.split('/')[0];
  let data = event.data.split('/')[1];
  if (type == 'balances'){
    let balances = JSON.parse(data);
    document.getElementById("asset_wrap").innerHTML = "";
    for(let i = 0; i < balances.length; i++) {
      document.getElementById("asset_wrap").innerHTML += "<div class='asset'><span class='name'>"+balances[i].ticker+"</span> <span class='h1'>1h%</span><span class='h24'>24h%</span><span class='d7'>7d%</span> <span class='price'>"+round(balances[i].price)+"</span><span class='holdings'>"+round(balances[i].amount)+"</span> <span class='value'>"+round(balances[i].amount)*round(balances[i].price)+"</span></div>"
    }
  }
  console.log("Message from server ", event.data.split('/')[0]);
});

function round(x){
  return Number.parseFloat(x).toFixed(2);
}

function requestChart(token,timeframe,duration){
  request('chart/'+token+'/'+timeframe+'/'+duration);
}

function request(message){
    socket.send(message);
}

function requestBalances(message) {
  request('getAllBalances/');
}

class Dashboard extends React.Component{

  constructor(props){
    super(props);
  }



  render(){

    return (
      <>
      <div id="content_wrap">
        <div id='accounts_wrap'>testtt</div>
        <div id="assets_wrap">
          <div id='total_value'>1000$</div>
          <div class='label'><span>Assets</span></div>
          <div id='asset_table_rows'>
            <span class='name'>Name</span> <span class='h1'>1h%</span><span class='h24'>24h%</span><span class='d7'>7d%</span> <span class='price'>Price</span> <span class='holdings'>Holdings</span> <span class='value'>Value</span>
          </div>
          <div id='asset_wrap'>
            <div class='asset'>
            <span class='name'>Name</span> <span class='h1'>1h%</span><span class='h24'>24h%</span><span class='d7'>7d%</span> <span class='price'>Price</span> <span class='holdings'>Holdings</span> <span class='value'>Value</span>
            </div>
          </div>
        </div>
      </div>
      <button onClick={requestBalances}>Click me</button>
      </>
    );

  }
};
export default Dashboard;
